export const baseUrl = process.env.REACT_APP_API_BASE_URL;
export const IDPTBaseUrl = REACT_APP_IDPT_API_BASE_URL;


export const axiosConfig = {
  baseURL: baseUrl,
  timeout: 60000 * 5,
  withCredentials: true,
};

export const axiosIDPTConfig = {
  baseURL: IDPTBaseUrl,
  timeout: 60000 * 5,
  withCredentials: true,
};

export const alertAutoHideDuration = 6000;

export const blobResponseURLs = [];

export const formDataURLs = [];
